in_code: |-
  S" Hello, world!" VARIABLE hello_world
  0x0 VARIABLE index
  0x0 VARIABLE len
  _start:
      lit len
      lit hello_world @
      !
      lit index
      lit hello_world
      lit 4
      +
      !
  while:
      lit index @ @
      out 2
      lit index
      dup
      @
      lit 4
      +
      !
      lit 1
      lit len @
      -
      dup
      if end
      lit len
      swap
      !
      jump while
  end:
      halt
